import React from 'react';
import { connect } from 'react-redux';

import './menu.scss';
import MenuItem from '../menu-item/MenuItem';

export const Menu = () => (
  <div className='menu'>
    {this.state.sections.map(({ id, ...otherSectionProps }) => (
      <MenuItem key={id} {...otherSectionProps} />
    ))}
  </div>
);

export default connect()(Menu);
